import '../../styles.css'
import Logo from "../../Logo.png";
//import 'bootstrap/dist/css/bootstrap.min.css';
import {NavbarBrand,Navbar} from 'reactstrap'
import Card from '../Card'

const App =()=>{
  return (
    <div>
    <Navbar
    color="light"
    expand="md"
    light
  >
    <NavbarBrand href="/">
      <img src={Logo} style={{width:"50%"}}/>
      nearby Therapist
    </NavbarBrand>
   {/* <NavbarToggler onClick={function noRefCheck(){}} /> */}
      </Navbar>
    <main>
    <Card/>
    </main>
  </div>
    
  );
  }

export default App;
